import { createSlice } from "@reduxjs/toolkit";

const initialState = {
    MyTodoarry: []
}
export const Mytodo = createSlice({
    name: "todo",
    initialState,
    reducers: {
        addtodo: (state, action) => {
            state.MyTodoarry.push(action.payload)
        }
    }

},

);
